import React from "react";
import {Navbar, Nav, NavLink} from 'react-bootstrap';
import {NavLink as RouterNavLink} from 'react-router-dom';

const TopNav = () => {
    return(
        <Navbar className="justify-content-end" bg="dark" variant="dark">
            <Nav className="justify-content-right">

                    <NavLink tag={RouterNavLink} to="/help">Help</NavLink>
                <Nav.Item>
                    <NavLink tag={RouterNavLink} to="/settings">Settings</NavLink>
                </Nav.Item>
                <Nav.Item>
                    <NavLink tag={RouterNavLink} to="/user">User</NavLink>
                </Nav.Item>
            </Nav>
        </Navbar>
    )
}

export default TopNav;
